cac:ProcurementProject.cbc:Description:
Sectorul 6 al Municipiului București (Primăria Sector 6) planifică, organizează și finalizează procedura de achiziție comună ocazională conform art. 44 din Legea 98/2016 cu modificările și completările ulterioare, în numele și pentru utilizatorii definiți mai jos, precum și monitorizarea acordului-cadru și a contractelor subsecvente centralizate, împreună cu aceștia:
1.	Direcția Generală de Asistență Socială și Protecția Copilului Sector 6; 
2.	Administrația Domeniului Public și Dezvoltare Urbană Sector 6; 
3.	Administrația Comercială Sector 6;
4.	Direcția Generală de Poliție Sector 6; 
5.	Centrul Cultural European Sector 6;
6.	Administrația Școlilor Sector 6;
7.	Centrul de sănătate Multifuncțional „Sfântul Nectarie” Sector 6;
8.	Direcția de Evidență a Persoanelor Sector 6; 
9.	Direcția Generală de Impozite și Taxe Locale Sector 6;
10.	Centrul Militar Sector 6.
Valoarea estimată a celui mai mare contract subsecvent este de 1.840.000 lei fără TVA.
